description:
Касcета AP600 А6 Tegular/Т24 используется в подвесных потолках - монтируется на подвесную систему. Кассета выполнена из устойчивого к влаге материала. Потолочную поверхность такого типа можно подвергать влажной уборке.Преимущества:· легкий вес;
· экономичность;
· долговечность;
· простота ухода;
· быстрый монтаж.Кассета имеет тонкое цинковое покрытие, которое защищает изделие от влияния внешних факторов и разрушения.

Шланг сливной для стиральной машины Equation - гофра изготовлена из РР полипропилена, блоксополимер пропилена и этилена, наконечник – направленный ТЭП;
Предназначен для слива воды из стиральных и посудомоечных машин всех типов.
Изделие не предназначено для питьевой воды. Страна производства — Россия.

Фасадный дюбель Standers используется для сквозного крепления к фасадам из разных материалов — камня, бетона, газо- и пенобетонных блоков, кирпича, керамзитобетона. Применяется при фиксации элементов фасадных конструкций, рам и планок к стенам. Дюбель помещается в подготовленное отверстие и фиксируется шурупом. В упаковке 2 дюбеля диаметром 10 мм и длиной 80 мм, а также 2 шурупа размером 7х85 мм с шестигранной головкой под ключ SW13 и шлицем ТORX40.-Шуруп из углеродистой стали устойчив к коррозии благодаря специальной антикоррозийной обработке методом термодиффузного цинкования по технологии «Термишин»;
-Удлиненное тело дюбеля удобно при сквозном креплении элементов;
-Надежное сцепление дюбеля со стеной позволяет ему выдерживать полезную нагрузку до 190 кг (зависит от материала основания);
-Рекомендуется устанавливать пластиковый анкер при температуре выше 0°С. При отрицательных температурах перед установкой храните анкер в тёплом помещении;
-При установке дюбеля сквозь не круглое отверстие (овальное отверстие в кронштейне) необходимо использовать дополнительную металлическую шайбу для предотвращения продавливания бортика дюбеля.

LITOCHROM 1-6 — затирочная смесь на основе цемента, минеральных наполнителей, высококачественных полимерных и органических добавок и цветных пигментов. Предназначена для затирки межплиточных швов, шириной от 1 до 6 мм включительно, при облицовке стен и полов керамической плиткой, стеклянной мозаикой, керамогранитом, натуральным камнем, агломератом.При разведении водой представляет собой удобный в работе кремоподобный пластичный раствор.После затвердения LITOCHROM 1-6 характеризуется:• высокой устойчивостью к механическому воздействию и деформации;
• хорошей адгезией к торцам плитки;
• низким водопоглощением;
• морозостойкостью;
• высокой устойчивостью к истиранию;
• низкой усадкой;
• отсутствием выцветания.LITOCHROM 1-6 предназначена для затирки межплиточных швов, шириной от 1 до 6 мм включительно, при облицовке стен и полов в:• жилых помещениях;
• промышленных помещениях, где не предъявляются требования к химической стойкости швов и не предполагается контакт с агрессивными веществами
• ванных, душевых, бассейнов, террас, балконов и т. д.;
• на деформирующихся основаниях, таких как гипсоволокнистые листы (ГВЛ), гипсокартон (ГКЛ), стекломагнезитовые листы (СМЛ).На основаниях подверженных интенсивному механическому воздействию, на «тёплых» полах, на основания с высокой водной нагрузкой, таких как влажные помещения, бассейны, чаши бассейнов, на балконах, террасах и т.д., рекомендуется затворять (смешивать) LITOCHROM 1-6 с латексной добавкой IDROSTUK-м без добавления воды (пропорции приготовления смеси указаны в технической информации). При этом улучшается эластичность затирочной смеси, увеличивается адгезия затирки к торцам плитки, уменьшается водопоглощение затирки в швах.LITOCHROM 1-6 применяется для затирки межплиточных швов всех видов керамической плитки, стеклянной мозаики, керамогранита, натурального камня, агломерата.Для внутренних и наружных работ.

Правило изготовлено из легкого и прочного алюминиевого сплава, который имеет оптимальные показатели долговечности. Благодаря этому инструмент не деформируется и не покрывается ржавчиной, им удобно работать.Два ребра обеспечивают дополнительную жесткость, помогая быстро распределять строительные смеси по поверхности и аккуратно их выравнивать. А оптимальный размер позволяет использовать инструмент для обработки узких и небольших по размеру участков.Преимущества:· два ребра жесткости;
· подходит для обработки узких участков;
· первичный алюминиевый сплав.

Фасадный дюбель Standers используется для сквозного крепления к фасадам из разных материалов — камня, бетона, газо- и пенобетонных блоков, кирпича, керамзитобетона. Применяется при фиксации элементов фасадных конструкций, рам и планок к стенам. Дюбель помещается в подготовленное отверстие и фиксируется шурупом. В упаковке 2 дюбеля диаметром 10 мм и длиной 115 мм, а также 2 шурупа размером 7х120 мм с шестигранной головкой под ключ SW13 и шлицем ТORX40.-Шуруп из углеродистой стали устойчив к коррозии благодаря специальной антикоррозийной обработке методом термодиффузного цинкования по технологии «Термишин»;
