-Надежное сцепление дюбеля со стеной позволяет ему выдерживать полезную нагрузку до 190 кг (зависит от материала основания);
-Рекомендуется устанавливать пластиковый анкер при температуре выше 0°С. При отрицательных температурах перед установкой храните анкер в тёплом помещении;
-При установке дюбеля сквозь не круглое отверстие (овальное отверстие в кронштейне) необходимо использовать дополнительную металлическую шайбу для предотвращения продавливания бортика дюбеля.

Прибор предназначен для использования с моделями отопительных модулей Ballu серии Evolution Transformer. Блок управления позволяет управлять работой конвектора.Отличительные особенности:3 Режима работы: Комфортный, Экономичный, Антизамерзание;
2 Режима мощности: автоматический и пользовательский;
Функция «Родительский контроль»;
Функция «Таймер на отключение» (до 24 часов);
Уникальный выносной термодатчик;Возможность подключения дополнительных аксессуаров:• Модуль Smart Eye
• Модуль Smart Wi-Fi

Нейлоновый дюбель PND L с удлиненной распорной зоной оптимально подходит для крепления в бетоне, полнотелом и пустотелом кирпиче и пористых основаниях, таких как вспененный бетон, керамзитобетон, газобетон. В упаковке 4 дюбеля диаметром 12 мм и длиной 100 мм, а также 4 шурупа размером 8,0×120 мм. Страна производства — Россия.-Сохраняет свои эксплуатационные свойства в условиях экстремально низких и экстремально высоких температур (от -40 до +80°С);
-Обладает способностью выдерживать повышенные нагрузки (до 150 кг в бетоне, до 100 кг – в кирпиче, до 40 кг в газобетоне);
-Дюбель рекомендуется использовать с универсальным шурупом диаметром 8,0-10,0 мм;
-Устойчив к повышенной влажности и механическим повреждениям.

Карниз двухрядный раздвижной «Грани» — конструкция с телескопическими штангами. Позволяет регулировать длину карниза под размеры оконных проемов. На двух рядах штанг можно комбинировать разные по плотности занавески. Основа выполнена из стали, выдержит даже тяжелые виды штор. Карниз монтируется на угол. В комплект входит все необходимое для установки — кронштейны, кольца, крючки, наконечники.Модель оформлена в стиле «классический шик». Форма наконечника — плоский квадрат. Покрытие глянцевое. Карниз подойдет для декорирования интерьера в классическом и неоклассическом стиле.Материал основы — сталь.Материал наконечника — алюминий.Длина штанги — от 160 до 300 см.Диаметр — 16/19 мм.Количество колец — 21 шт.Тип основания — двойной открытый.Расстояние от стены:
- до первой штанги 7.9 см;
- до второй штанги 14.4 см.

