Анкер PBAM Standers (тип Driva) используется для фиксации крепежных элементов на стенах из гипсокартона, пено- и газобетонных блоков. Дюбель изготовлен из стеклонаполненного нейлона, за счет повышенного содержания стекловолокна в нейлоне, может использоваться для всех видов гипсокартонных листов, включая усиленный и реставрационный. Отлично держится в рыхлой и легко крошащейся структуре материала благодаря двойной винтовой спирали. Заменяет аналогичные металлические анкеры. В упаковке 50 дюбелей диаметром 14 мм и длиной 39 мм, а также 50 шурупов размером 4,5х35 мм. Страна производства — Россия.-Просто и быстро монтируется без предварительного сверления отверстий при помощи крестообразной отвертки или шуруповерта;
-Подходит для одно- и двухслойной гипсокартонной обшивки;
-Полезная нагрузка гипсокартон 1 лист 12,5 мм - до 15 кг, гипсокартон 2 листа 12,5 мм - до 25 кг;
-Полезная нагрузка газобетон до 30 кг.
